import React from "react";
import { useCookies } from "react-cookie";
//Home Page
function Home() {
    const [cookies, setCookies] = useCookies(["access_token"]);
    return (
        <div>
            <h1>Home Page :D</h1>
            {!cookies.access_token ?  <a href="http://localhost:3000/register">Register</a> : <h1>Logged in</h1>}
            
            <button>Logout </button>
        </div>
    );
}

export default Home;
